import React from "react";

export default function Home({objs,nav}){

    const navReturn=(text)=>{
        if(text==='Home'){
            return '#bg'
        }else if(text==='Products'){
            return '#content'
        }else return text
    }
    return(
        <div className="container">
            <div id="bg">
                <header>
                    <div className="logoP">
                        <img className="logo" src="imgs/logo/logo.png" alt="logo"/>
                    </div>
                    <nav>
                        {nav.map(e=><a key={e.id} href={navReturn(e)}>{e}</a>)}
                    </nav>
                </header>

                <div className="bodyDiv">
                    <div className="textP">
                        <h1>TIMBERLANDÂ® PREMIUM SHOES</h1>
                    </div>
                    <div className="shoeE">
                        <img src="imgs/img/shoesErase1.png" alt="shoe"/>
                    </div>
                </div>
            </div>
            
            <div id="content">
                {objs.map((e,i)=>
                    <div key={i} className="shoesP">
                        <div>
                            <img src={e.src} alt=""/>
                        </div>
                        <div>
                            <p>{e.price}$</p>
                            <p>{e.desc}</p>
                            <input type='button' value='Add To Cart'/>
                        </div>
                    </div>
                )}
            </div>
        </div>
    )
}
